	<p id="a"></p>
	<script>
$(document).ready(function() {
	/**
	 * Takes a list of words and iterates over it to count the number of instances of each word.
	 */

	var list = getList();
	list.sort();
	
	// Hash map that will hold key-value pairs of words and the number of times that word appears
	var map = {};
	// Parsing - Keeps track of the first instance of a repeated word
	var currentWord = list[0];
	// Parsing - Counts the number of instances of a repeated word
	var count = 0;
	// Debug - Ensure no data is lost
	var totalCount = 0;

	// Populate the map
	for (var word of list) {
		word = `${word.toLowerCase()}/${word.charAt(0).toUpperCase() + word.slice(1)}`;
		if (word != currentWord) {
			if (!map[currentWord]) {
				map[currentWord] = 0;
			}
			map[currentWord] += count;
			totalCount += count;
			currentWord = word;
			count = 1;
		} else {
			count++;
		}
	}
	// Do not forget the last element in the list
	map[currentWord] = count;
	totalCount += count;

	// Keep track of the total number of elements that were counted
	console.log(currentWord, totalCount);

	totalCount = 0;

	// Display the results in the web page
	var displayStr = ""
	var words = Object.keys(map);
	for (var word of words) {
		totalCount += map[word];
		displayStr += word + "\t" + map[word] + "<br/>";
	}
	$("#a").html(displayStr);
	
	// Validate the total count is as expected, and no data was lost
	console.log(totalCount);
});
